 type Props = {
   hardware: "videocards" | "processor" | "cases" | "coolers" | "hdd" | "moutherboards" | "power" | "ram" | "ssd";
 }
 
 
 export const getHardware = async (hardware : Props) => {
    let res = await fetch(`api/${hardware}`);
    return await res.json();
   }



   

   


   



// eslint-disable-next-line import/no-anonymous-default-export
   export default {
      getHardware,
   };
